BEGIN TRANSACTION;

PRAGMA foreign_keys = 0;
PRAGMA cache_size = 0;

CREATE TABLE Orgao_Exercicio(
   ID_ORGAO       NUMERIC(7,2)  NOT NULL PRIMARY KEY 
  ,NOME_ORG_EXERC VARCHAR(40) NOT NULL
  ,UORG           VARCHAR(40)
  ,UF_UORG        VARCHAR(2)
);
CREATE TABLE Gratificacao(
   ID_GRATIFICACAO    NUMERIC(3,0) NOT NULL PRIMARY KEY 
  ,NIVEL_GRATIFICACAO VARCHAR(2)
  ,NOME_RUBRICA       VARCHAR(30)
  ,VALOR              NUMERIC(8,2)
);
CREATE TABLE Cargo(
   ID_CARGO           INTEGER  NOT NULL PRIMARY KEY 
  ,NOME_CARGO         VARCHAR(40)
  ,ESCOLARIDADE_CARGO VARCHAR(2)
);
CREATE TABLE Unidade_Pagadora(
   ID_UPAG   NUMERIC(7, 2)  NOT NULL PRIMARY KEY 
  ,NOME_UPAG VARCHAR(40) NOT NULL
  ,UF_UPAG   VARCHAR(2) NOT NULL
);
CREATE TABLE Servidor(
   ID_SERVIDOR           INTEGER  NOT NULL PRIMARY KEY 
  ,NOME_SERVIDOR         VARCHAR(54) NOT NULL
  ,CPF                   VARCHAR(11) NOT NULL
  ,ESCOLARIDADE_SERVIDOR VARCHAR(30) NOT NULL
  ,ID_CARGO              INTEGER 
  ,ID_ORGAO              NUMERIC(7, 2)
  ,FOREIGN KEY (ID_CARGO) REFERENCES Cargo(ID_CARGO)
  ,FOREIGN KEY (ID_ORGAO) REFERENCES Orgao_Exercicio(ID_ORGAO)
);
CREATE TABLE Pagamento(
   ID_SERVIDOR     INTEGER  NOT NULL PRIMARY KEY 
  ,ID_UPAG         NUMERIC(7, 2) NOT NULL 
  ,ID_GRATIFICACAO NUMERIC(7, 2) NOT NULL
  ,FOREIGN KEY (ID_SERVIDOR) REFERENCES Servidor(ID_SERVIDOR)
  ,FOREIGN KEY (ID_UPAG) REFERENCES Unidade_Pagador(ID_UPAG)
  ,FOREIGN KEY (ID_GRATIFICACAO) REFERENCES Gratificacao(ID_GRATIFICACAO)
);
CREATE TABLE Cargo_Orgao(
   ID_CARGO INTEGER  NOT NULL
  ,ID_ORGAO NUMERIC(7, 2) NOT NULL
  ,PRIMARY KEY(ID_CARGO,ID_ORGAO)
  ,FOREIGN KEY (ID_CARGO) REFERENCES Cargo(ID_CARGO)
  ,FOREIGN KEY (ID_ORGAO) REFERENCES Orgao_Exercicio(ID_ORGAO)
);
COMMIT;
